@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("www.terracaching.com") {
body {
background-color:#FFF !important;
color:transparent !important;
margin:0 10% !important;
background-attachment:fixed !important;
background-repeat:repeat-x !important;
background-image:url("data:image/png;base64,")!important;
}
font[color='#000000'], td, p {
font-family:"Lucida Sans Unicode","Lucida Grande",Verdena,arial,sans-serif !important;
color:#444!important;
}
table, th, td {
border-style:none!important;
}
.gen, .genmed, .gensmall, .gentiny {
color:#444!important;
}
.genalt {
color:#888!important;
}
a.postlink {
text-decoration:underline!important;
}
a:link, a:active, a:visited {
color:#444 !important;
}
a:hover {
color:#444;
text-decoration: none !important;
background-image:url("data:image/png;base64,")!important;
background-position:0 bottom!important;
}
td[align="left"]+td[align="right"]>span.gensmall, .gensmall>a.gensmall {
color:#999!important;
background-image:none!important;
}
hr {
border-color:#999 !important;
border-style:solid !important;
border-width:1px 0 0 !important;
height:0 !important;
}
.bodyline {
background-color:black !important;
border:0 none !important;
background-repeat: repeat-x!important;
background-image:url("data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAC3CAYAAADThjThAAAACXBIWXMAAAsSAAALEgHS3X78AAAAj0lEQVQokaWQuQ4DIQxEJ275/y/jL2g4C6QIJkX2UJYrq22QPX6MxobW+i1KqZcYYyjOOYr3nhJjhKSUNs1aWyWEQMk5QwBASG7PsAUAqbXyW124E9m55m8ppee30oapWo7jVBett1sv3y2Dn6rJMj/sk6p3xHmqITIPOW/vDviP/blbb/pYaxGukZXL8XwA3bQRbTvONGoAAAAASUVORK5CYII=")!important;
padding:0px 2.5% 10px 2.5%!important;
background-position:left top!important;
-moz-border-radius:11px!important;
border-right:5px solid #888!important;
border-bottom:3px solid #888!important;
}
.bodyline>table {
margin-top:15px!important;
}
table.bodyline{
background-image:none!important;
border:1px solid #000!important;
background-color:transparent !important;
-moz-border-radius:6px!important;
padding:0px!important;
}
.main-background {
background-color:#FFF!important;
-moz-border-radius:15px!important;
padding:0 0 1px 1px!important;

background-image:url("data:image/png;base64,")!important;
background-repeat: repeat!important;
}

.forumline {
background-color:transparent!important;
border-color:black!important;
border-style:none!important;
border-width:2px;
-moz-border-radius:6px!important;
}
.cattitle {
color:#555!important;
font-family:Trebuchet MS,Arial,sans-serif !important;
font-size:14px!important;
letter-spacing:0px!important;
}
td.row1, tr.row1 {
background-color:transparent!important;
min-width:50px!important;
}
input.row1 {
background-color:transparent!important;
border:0 none;
}
td.row2, tr.row2 {
background-color:transparent!important;
}
input.row2 {
background-color:transparent!important;
border:0 none;
}
td.row3, tr.row3 {
background-color:transparent!important;
}
input.row3 {
background-color:transparent!important;
border:0 none;
}
td.rowpic {
background-color:transparent!important;
}
th {
background-color:transparent!important;
color:#444!important;
font-family:Trebuchet MS,Arial,sans-serif !important;
font-size:12px!important;
font-weight:bold!important;
height:20px;
}
td.cat, td.catHead, td.catSides, td.catLeft, td.catRight {
background-color:transparent!important;
font-family:Trebuchet MS,Arial,sans-serif !important;
height:20px;
}
td.catBottom {
background-color:transparent!important;
height:20px;
}
th.thHead, th.thSides, th.thTop, th.thLeft, th.thRight, th.thBottom, th.thCornerL, th.thCornerR {
font-family:Trebuchet MS,Arial,sans-serif !important;
font-weight:bold;
height:20px;
}
td.row3Right, td.spaceRow {
background-color:transparent!important;
}
th.thHead, td.catHead {
border-width:0 !important;
font-family:Trebuchet MS,Arial,sans-serif !important;
font-size:12px;
}
th.thSides, td.catSides, td.spaceRow {
border-width:0!important;
}
th.thRight, td.catRight, td.row3Right {
border-width:0!important;
}
th.thLeft, td.catLeft {
border-width:0!important;
}
th.thBottom, td.catBottom {
border-width:0!important;
}
th.thTop {
border-width:0!important;
}
th.thCornerL {
border-width:0!important;
}
th.thCornerR {
border-width:1px 1px 0 0;
}
.maintitle, h1, h2, a.maintitle:link, a.maintitle:visited {
color:#444!important;
}
.udm li a:visited {
background-color:transparent!important;
border:none!important;
}
.udm a, .udm a:link, .udm a.nohref {
background-color:transparent!important;
border:none!important;
color:#555!important;
font-size:14px!important;
letter-spacing:0px!important;

font-family:Trebuchet MS,Arial,sans-serif !important;
}
.udm li a.udmR, .udm li a.udmY, .udm li a.udmR:visited, .udm li a.udmY:visited, .udm li a:hover, .udm li a:focus, .udm li a.nohref:hover, .udm li a.nohref:focus {
background-color:transparent!important;
border:none!important;
color:#FFF;
background-image:url("data:image/png;base64,") !important;
 -moz-border-radius:6px!important;
}
.udm ul {
background-color:transparent!important;
background-image:url("data:image/png;base64,") !important;
border:1px outset #555!important;
}
#udm>li ul{
 -moz-border-radius:6px!important;
}
img[src="/images/logo-final.jpg"]
{
	width:0!important;
	height:65px!important;
	padding-left:350px!important;
        margin-left:1px!important;
	background-image:url("data:image/png;base64,");
}
.thHead .row1
{
	background-color:transparent!important;
	border:0!important;
	-moz-border-radius:8px!important;
        background-image:url("data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAoAAAAKCAYAAACNMs+9AAAABGdBTUEAAK/INwWK6QAAABl0RVh0U29mdHdhcmUAQWRvYmUgSW1hZ2VSZWFkeXHJZTwAAAAbSURBVHjaYtznp7OZgQjAxEAkGFVIHYUAAQYAH38B/6lXuNUAAAAASUVORK5CYII=")!important;
}
.thHead .row1 a:hover {
        background-image:none!important;
text-decoration: none !important;
}
.row1 table[width="150"] {
border-style:solid!important;
border-width:1px!important;
-moz-border-radius:8px!important;
background-image:none!important;
margin-left:5px!important;
}
#udm kbd {
font-size:0.8em!important;
border-color:#AAA!important;
padding:0.1em 0.2em 0.1em 0.2em!important;
top:-0.1em!important;
}
.spacerow img{
border-style:solid!important;
border-width:1px 0 0 0!important;
border-color:#999!important;
height:1px!important;
width:100%!important;
}
.copyright{
color:#999!important;
}
a.copyright,a.copyright:hover{
color:#BBB!important;
background-image:none!important;
}
td.row1[width="50"]+td.row1, td.row1+td.row2[height="50"],td.row2+td.row2[height="50"]{
border-width:1px 1px 1px 1px!important;
border-style:solid!important;
border-color:#AAA!important;
-moz-border-radius:6px!important;
}
a[href="javascript:getOption('BADGE_DESCRIPTIONS','');"]{
float:left!important;
}
td.row1[rowspan="5"]{
border-style:solid!important;
border-width:1px!important;
border-color:#444!important;
-moz-border-radius:6px!important;
-moz-border-radius-bottomright:14px!important;
}
td.gensmall[align="right"]>table {
border-style:solid!important;
border-width:1px!important;
border-color:#444!important;
-moz-border-radius:6px!important;
}
.code {
font-family:"Lucida Console",monospace!important;
}
.quote {
background:#EEE!important;
}
.gen img{
max-width:600px!important;;
}
table[width="100%"]>tbody>tr>td[colspan="2"] {
width:100%!important;
}
input.post, textarea.post, select {
background-color:#EEE!important;
border:1px solid #222!important;
}
.right {
width:1px!important;
}
td.genmed[width="5"] {
text-align:right!important;
}
}
